// frontend/src/App.jsx
import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Login from './pages/Login';
import Layout from './components/Layout';
import AdminDashboard from './pages/admin/Dashboard';
import UsersManagement from './pages/admin/UsersManagement';
import GamesManagement from './pages/admin/GamesManagement';
import Settings from './pages/admin/Settings';
import EmployeeDashboard from './pages/employee/Dashboard';
import Rentals from './pages/employee/Rentals';
import './App.css';

// Middleware للتحقق من المصادقة
const PrivateRoute = ({ children, allowedRoles = [] }) => {
  const token = localStorage.getItem('token');
  const userStr = localStorage.getItem('user');
  
  if (!token || !userStr) {
    return <Navigate to="/login" replace />;
  }
  
  try {
    const user = JSON.parse(userStr);
    
    if (allowedRoles.length > 0 && !allowedRoles.includes(user.role)) {
      // إذا كان المستخدم ليس لديه الصلاحية، نعيده للوحة التحكم المناسبة
      if (user.role === 'admin') {
        return <Navigate to="/admin/dashboard" replace />;
      } else {
        return <Navigate to="/employee/dashboard" replace />;
      }
    }
    
    return children;
  } catch (error) {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    return <Navigate to="/login" replace />;
  }
};

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* صفحة تسجيل الدخول */}
        <Route path="/login" element={<Login />} />
        
        {/* المسارات المحمية */}
        <Route path="/" element={
          <PrivateRoute>
            <Layout />
          </PrivateRoute>
        }>
          {/* المسارات العامة */}
          <Route index element={<Navigate to="/employee/dashboard" replace />} />
          
          {/* مسارات المدير */}
          <Route path="admin/dashboard" element={
            <PrivateRoute allowedRoles={['admin']}>
              <AdminDashboard />
            </PrivateRoute>
          } />
          
          <Route path="admin/users" element={
            <PrivateRoute allowedRoles={['admin']}>
              <UsersManagement />
            </PrivateRoute>
          } />
          
          <Route path="admin/games" element={
            <PrivateRoute allowedRoles={['admin']}>
              <GamesManagement />
            </PrivateRoute>
          } />
          
          <Route path="admin/settings" element={
            <PrivateRoute allowedRoles={['admin']}>
              <Settings />
            </PrivateRoute>
          } />
          
          {/* مسارات الموظفين */}
          <Route path="employee/dashboard" element={
            <PrivateRoute allowedRoles={['admin', 'branch_manager', 'employee']}>
              <EmployeeDashboard />
            </PrivateRoute>
          } />
          
          <Route path="employee/rentals" element={
            <PrivateRoute allowedRoles={['admin', 'branch_manager', 'employee']}>
              <Rentals />
            </PrivateRoute>
          } />
          
          {/* إذا كانت هناك صفحات غير موجودة، توجيه للصفحة الرئيسية */}
          <Route path="*" element={<Navigate to="/employee/dashboard" replace />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
